import dayjs from "dayjs";

// Base64 Encoded Logos
const logoLeft =
  "data:image/png;base64,";
const logoRight =
  "data:image/jpeg;base64,";

const loadImage = (src) => {
  return new Promise((resolve, reject) => {
    const img = new Image();
    img.onload = resolve;
    img.onerror = reject;
    img.src = src;
  });
};

export const handlePrint = async ({
  checkIns,
  filterType,
  startDate,
  endDate,
  handlePrintDialogClose,
  logUserAction,
  LoguserId,
}) => {
  try {
    await Promise.all([loadImage(logoLeft), loadImage(logoRight)]);

    let filteredCheckIns;
    switch (filterType) {
      case "year":
        filteredCheckIns = checkIns.filter((checkin) => {
          const checkInDate = dayjs(checkin.check_in);
          return checkInDate.isSame(startDate, "year");
        });
        break;
      case "month":
        filteredCheckIns = checkIns.filter((checkin) => {
          const checkInDate = dayjs(checkin.check_in);
          return checkInDate.isSame(startDate, "month");
        });
        break;
      case "day":
        filteredCheckIns = checkIns.filter((checkin) => {
          const checkInDate = dayjs(checkin.check_in);
          return checkInDate.isSame(startDate, "day");
        });
        break;
      case "range":
        filteredCheckIns = checkIns.filter((checkin) => {
          const checkInDate = dayjs(checkin.check_in);
          return (
            (!startDate ||
              checkInDate.isAfter(startDate) ||
              checkInDate.isSame(startDate, "day")) &&
            (!endDate ||
              checkInDate.isBefore(endDate) ||
              checkInDate.isSame(endDate, "day"))
          );
        });
        break;
      default:
        filteredCheckIns = checkIns;
    }

    const printContent = `
      <div class="header-container" style="text-align: center; border-bottom: 1px solid #000; padding-bottom: 10px; font-family: Arial, sans-serif;">
          <img src="${logoRight}" alt="Left Logo" style="display: inline-block; vertical-align: middle; width: 100px; height: auto;">
          <div style="display: inline-block; vertical-align: middle; text-align: center; width: 60%;">
            <h1 style="margin: 0; font-size: 18px; font-weight: bold;">Republic of the Philippines</h1>
            <h2 style="margin: 0; font-size: 16px; font-weight: bold;">ZAMBOANGA PENINSULA POLYTECHNIC STATE UNIVERSITY</h2>
            <h3 style="margin: 0; font-size: 14px;">Region IX, Zamboanga Peninsula<br>R.T. Lim Blvd., Zamboanga City</h3>
            <h2 style="margin: 0; font-size: 16px; font-weight: bold;">SCHOOL OF BUSINESS ADMINSTRATION</h2>
            <h2 style="margin: 0; font-size: 16px; font-weight: bold;">TRANSACTION REPORT</h2>
          </div>
          <img src="${logoLeft}" alt="Right Logo" style="display: inline-block; vertical-align: middle; width: 100px; height: auto;">
        </div>

      <table border="1" style="width: 100%; border-collapse: collapse; margin: 20px 0;">
        <thead style="background-color: #f1f1f1;">
          <tr>
            <th style="padding: 8px;">Guest ID</th>
            <th style="padding: 8px;">Guest Name</th>
            <th style="padding: 8px;">Room No.</th>
            <th style="padding: 8px;">Check In</th>
            <th style="padding: 8px;">Check Out</th>
            <th style="padding: 8px;">Guest No.</th>
          </tr>
        </thead>
        <tbody>
          ${filteredCheckIns
            .map(
              (checkin) => `
            <tr>
              <td style="padding: 8px;">${checkin.guestId}</td>
              <td style="padding: 8px;">${checkin.guestName}</td>
              <td style="padding: 8px;">${checkin.room_number}</td>
              <td style="padding: 8px;">${checkin.check_in}</td>
              <td style="padding: 8px;">${checkin.check_out}</td>
              <td style="padding: 8px;">${checkin.guestNumber}</td>
            </tr>
          `
            )
            .join("")}
        </tbody>
      </table>
    `;

    const printWindow = window.open("", "PRINT", "height=600,width=800");
    printWindow.document.write(`
      <html>
        <head>
          <title>Print</title>
          <style>
            body { font-family: Arial, sans-serif; margin: 20px; }
            table { width: 100%; border-collapse: collapse; }
            th, td { border: 1px solid #ddd; padding: 8px; text-align: center; }
            th { background-color: #f1f1f1; }
          </style>
        </head>
        <body>
          ${printContent}
        </body>
      </html>
    `);
    printWindow.document.close();
    printWindow.focus();
    printWindow.print();
    printWindow.close();
    handlePrintDialogClose();
    logUserAction(LoguserId, "Printed stay records history");
  } catch (error) {
    console.error("An error occurred during the print process:", error);
  }
};
